import React, { useState, useEffect } from 'react';
import { Table, Badge, Button, Modal, Form } from 'react-bootstrap';
import interviewService from '../../services/interviewService';
import { toast } from 'react-toastify';

const InterviewList = ({ interviews: initialInterviews }) => {
    const [interviews, setInterviews] = useState(initialInterviews || []);
    const [showModal, setShowModal] = useState(false);
    const [selectedInterview, setSelectedInterview] = useState(null);
    const [newStatus, setNewStatus] = useState('');

    useEffect(() => {
        if (initialInterviews) {
            setInterviews(initialInterviews);
        }
    }, [initialInterviews]);

    const getStatusVariant = (status) => {
        const variants = {
            'Invited': 'info',
            'Scheduled': 'primary',
            'Completed': 'success',
            'Cancelled': 'danger',
            'No-Show': 'warning'
        };
        return variants[status] || 'secondary';
    };

    const handleStatusUpdate = (interview) => {
        setSelectedInterview(interview);
        setNewStatus(interview.Status);
        setShowModal(true);
    };

    const submitStatusUpdate = async () => {
        try {
            await interviewService.updateStatus(selectedInterview.Id, newStatus);
            
            // Update local state
            setInterviews(interviews.map(interview => 
                interview.Id === selectedInterview.Id 
                    ? { ...interview, Status: newStatus }
                    : interview
            ));
            
            toast.success('Interview status updated successfully');
            setShowModal(false);
        } catch (error) {
            toast.error('Failed to update interview status');
        }
    };

    return (
        <>
            <div className="d-flex justify-content-between align-items-center mb-3">
                <h5><i className="bi bi-calendar-check me-2"></i>Scheduled Interviews</h5>
                <Badge bg="info">{interviews.length} Total</Badge>
            </div>

            <div className="table-responsive">
                <Table striped bordered hover>
                    <thead className="table-dark">
                        <tr>
                            <th>Student</th>
                            <th>Email</th>
                            <th>Slot Date & Time</th>
                            <th>Interviewer</th>
                            <th>Status</th>
                            <th>Meeting Link</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {interviews.length === 0 ? (
                            <tr>
                                <td colSpan="7" className="text-center text-muted">
                                    No interviews scheduled yet
                                </td>
                            </tr>
                        ) : (
                            interviews.map(interview => (
                                <tr key={interview.Id}>
                                    <td>{interview.StudentName}</td>
                                    <td>{interview.StudentEmail}</td>
                                    <td>
                                        {interview.SlotDateTime ? 
                                            new Date(interview.SlotDateTime).toLocaleString() 
                                            : '-'
                                        }
                                    </td>
                                    <td>{interview.Interviewer || '-'}</td>
                                    <td>
                                        <Badge bg={getStatusVariant(interview.Status)}>
                                            {interview.Status}
                                        </Badge>
                                    </td>
                                    <td>
                                        {interview.MeetingLink ? (
                                            <a 
                                                href={interview.MeetingLink} 
                                                target="_blank" 
                                                rel="noopener noreferrer"
                                                className="btn btn-sm btn-outline-primary"
                                            >
                                                <i className="bi bi-camera-video me-1"></i>
                                                Join
                                            </a>
                                        ) : '-'}
                                    </td>
                                    <td>
                                        <Button
                                            size="sm"
                                            variant="outline-secondary"
                                            onClick={() => handleStatusUpdate(interview)}
                                        >
                                            <i className="bi bi-pencil me-1"></i>
                                            Update
                                        </Button>
                                    </td>
                                </tr>
                            ))
                        )}
                    </tbody>
                </Table>
            </div>

            {/* Status Update Modal */}
            <Modal show={showModal} onHide={() => setShowModal(false)}>
                <Modal.Header closeButton>
                    <Modal.Title>Update Interview Status</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Form>
                        <Form.Group>
                            <Form.Label>Interview Status</Form.Label>
                            <Form.Select 
                                value={newStatus} 
                                onChange={(e) => setNewStatus(e.target.value)}
                            >
                                <option value="Invited">Invited</option>
                                <option value="Scheduled">Scheduled</option>
                                <option value="Completed">Completed</option>
                                <option value="Cancelled">Cancelled</option>
                                <option value="No-Show">No-Show</option>
                            </Form.Select>
                        </Form.Group>
                    </Form>
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={() => setShowModal(false)}>
                        Cancel
                    </Button>
                    <Button variant="primary" onClick={submitStatusUpdate}>
                        Update Status
                    </Button>
                </Modal.Footer>
            </Modal>
        </>
    );
};

export default InterviewList;
